INSERT INTO course(course_id, name, identifier, description, audience, alternate_name)
VALUES ('93352a36-7307-4623-b977-183167ef0f08', 'Plum Course', 'PC0', 'Torrens carpo solium argumentum ustilo angustus tripudio agnitio angelus. Suggero talis sumptus necessitatibus tolero barba aureus. Thymum adfectus curiositas comis cernuus.', 'Sexual offence', 'PC'),
       ('8843d02c-b2a6-4c14-becf-6a5eb2e79c3d', 'Teal Course', 'TC1', 'Supplanto cunabula depraedor nobis amita pectus. Considero caterva voveo. Odit alii verto decens approbo beatae spero. Trado urbs viridis conduco ars adfero debilito voveo commodo praesentium. Approbo torqueo censura pectus occaecati vinum causa tergo una adeptio.', 'General violence offence', 'TC'),
       ('9796c685-8f68-468f-8d9d-2e791827dc26', 'Maroon Course', 'MC2', 'Vitiosus cenaculum recusandae tamdiu pecto aliqua aer surculus eius doloribus. Ullam attero repudiandae placeat alienus approbo est spes vesco tutis. Trucido curiositas usque adhaero a cilicium creptio vitiosus. Illum surculus pecto decor censura.', 'General offence', 'MC'),
       ('17af90df-c5d2-41e7-887c-d116345ec95a', 'Pink Course', 'PC3', 'Convoco thorax tabesco. Tactus id adfero incidunt.', 'General offence', 'PC'),
       ('d5449904-6725-49ee-85ea-e9b1f538738e', 'Cyan Course', 'CC4', 'Vivo incidunt depereo. Coma reprehenderit cunae comminor adimpleo adhaero turpis. Congregatio amet claustrum in arbustum minima umquam una. Sperno titulus vivo basium clibanus. Vir aliquid decerno demonstro stultus ratione adhuc stultus quisquam congregatio.', 'Sexual offence', 'CC'),
       ('f699ab2d-d650-4c3b-b10d-39e5dc849a2a', 'Turquoise Course', 'TC5', 'Canto armarium tersus stabilis timidus cena crepusculum. Vir alter tam trado vitae deduco.', 'Sexual offence', 'TC'),
       ('2a10c1b0-1d60-4d90-8fe9-fbb298716dea', 'Fuchsia Course', 'FC6', 'Verbera sponte demoror tendo tum valens unus dolores. Corporis conor vesco deorsum cursus. Aperio cado incidunt demens arcesso arceo causa somniculosus.', 'Sexual offence', 'FC'),
       ('f0225917-82a6-42fd-a2d8-1451f02c3bbd', 'Magenta Course', 'MC7', 'Ventosus perferendis cognatus sapiente viridis excepturi alius vitium. Cotidie conventus adfero victus depono fugiat volup contigo. Surculus cum atrox curriculum demum timidus. Solitudo necessitatibus quidem damnatio nesciunt capitulus crinis tutis baiulus. Admiratio arcus tonsor.', 'Extremism offence', 'MC'),
       ('9d38ce12-a49a-434a-a1c5-3181629e7114', 'Silver Course', 'SC8', 'Reiciendis titulus quam damno careo umquam aro fuga adicio. Concido bibo studio tutamen communis. Audax coepi abeo admitto capitulus stipes perspiciatis angelus.', 'Sexual offence', 'SC'),
       ('9e414bb8-0d5f-4a39-8d50-6fe2b9b945ca', 'Orchid Course', 'OC9', 'Ullus ascit teres ver laboriosam. Attollo utrimque spiculum collum adsidue subiungo. Synagoga aurum spargo doloribus urbanus sustineo tero vulgus deporto armarium. Avarus verbum aperte a. Ad veritatis aegrotatio absorbeo carcer caecus thymbra caritas.', 'General violence offence', 'OC');

